	         map(filter(level.chars, type in ['milgram_block', 'milgram.ground_slash', 'milgram.guided_missile', 'milgram.energy_shot']), 'obj', set(obj.hitpoints, 0)),
	         set(solid_dimensions_in, []),
	         set(collide_dimensions_in, []),
			 set(level.player.facing, if(me.midpoint_x < level.player.midpoint_x, -1, 1)),
			 set(me.facing, if(me.midpoint_x < level.player.midpoint_x, 1, -1)),
			 if(abs(midpoint_x - level.player.midpoint_x) < 200,
			    fire_event('do_dialog'),
				if(level.player.midpoint_x < midpoint_x,
